using System;
using System.IO;

namespace LogAnalyzer
{
	class Program
	{
		static void Main(string[] args)
		{

			string logPath = "";
			StreamReader reader = new StreamReader(logPath);


			string line;
			while ((line = reader.ReadLine()) != null)
			{

				if (line.Contains("Visited website"))
				{

					string websiteName = line.Substring(line.IndexOf(""") + 1, line.Length - 2);


					userActions.Add(websiteName);
				}


				if (line.Contains("Installed extension"))
				{

					string extensionName = line.Substring(line.IndexOf(""") + 1, line.Length - 2);


					userActions.Add(extensionName);
				}
			}


			reader.Close();


			foreach (string action in userActions)
			{
				Console.WriteLine(action);
			}
		}
	}
}

